import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link,
  useNavigate
} from "react-router-dom";

import TemplateGenerator from './TemplateGenerator';
import {LoginPage, RegisterPage} from './Login'
import logo from './logo.svg';
import './App.css';
import Cookies from 'js-cookie';

function App() {
  let navigate = useNavigate();
  var csrftoken = Cookies.get('csrftoken');
  if (!csrftoken){
    fetch('csrf')
    .then(function(){
      console.log("got CSRF")
    })
  }
  return(
    <div>
    <div onClick={() => {navigate('/login') }}>Users</div>
    <div onClick={() => {navigate('/new-location') }}>Reports</div>
    <div onClick={() => {navigate('/new-location') }}>Dashboards</div>
    <div onClick={() => {navigate('/new-location') }}>Data Sources</div>
    <Router>
      <Routes>
        <Route path="/" element={<TemplateGenerator />} />
      </Routes>
    </Router>
    </div>
  );
}

export default App;
